      deployments:
        - name: traefikee-operator
          spec:
            replicas: 1
            selector:
              matchLabels:
                name: traefikee-operator
            strategy: {}
            template:
              metadata:
                labels:
                  name: traefikee-operator
              spec:
                containers:
                  - command:
                      - /usr/local/bin/ao-logs
                      - /tmp/ansible-operator/runner
                      - stdout
                    image: containous/traefikee-operator:v2.1.0
                    imagePullPolicy: IfNotPresent
                    name: ansible
                    resources: {}
                    volumeMounts:
                      - mountPath: /tmp/ansible-operator/runner
                        name: runner
                        readOnly: true
                  - env:
                      - name: WATCH_NAMESPACE
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.namespace
                      - name: POD_NAME
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.name
                      - name: OPERATOR_NAME
                        value: traefikee-operator
                      - name: ANSIBLE_GATHERING
                        value: explicit
                      - name: RELATED_IMAGE_TRAEFIKEE
                        value: docker.io/store/containous/traefikee:v2.1.0-ubi
                    image: containous/traefikee-operator:v2.1.0
                    imagePullPolicy: IfNotPresent
                    name: operator
                    resources: {}
                    volumeMounts:
                      - mountPath: /tmp/ansible-operator/runner
                        name: runner
                serviceAccountName: traefikee-operator
                volumes:
                  - emptyDir: {}
                    name: runner
      permissions:
